import React, { PureComponent } from 'react'

class User extends PureComponent {
constructor(){
    super();
    this.state={
        fetchedData: []
    }
}

fetchData() {
    fetch(`http://localhost:8081/user`)
      .then((res) => res.json())
      .then((fetchedData) => this.setState({ fetchedData }));
}

  render() {
    return (
        <p>{this.state.fetchData}</p>
        )
  }
}

export default User
